(function(){var loadHandler=window['sl_{84348503-EF06-4105-9577-DA09BFBCB03C}'];loadHandler&&loadHandler(7, '<div id="spr0_907629b7"><div id="spr1_907629b7" class="kern slide"><img id="img2_907629b7" src="data:image/png;base64," width="960px" height="540px" alt="" style="left:0px;top:0px;"/></div><div id="spr2_907629b7" class="kern slide"><div id="spr3_907629b7" style="left:83.072px;top:3.081px;"><div style="width:0px;"><span id="txt0_907629b7" data-width="550.669922" style="left:140.338px;top:4.134px;">Why did we order the following tests?</span></div></div><div id="spr4_907629b7" style="left:48.928px;top:60.853px;"><div id="spr5_907629b7"><img id="img0_907629b7" src="data:image/png;base64," width="864.14" height="461.719" alt=""/></div><div id="spr6_907629b7" style="left:-0.002px;top:3.6px;"><div style="width:0px;"><span id="txt1_907629b7" data-width="97.294922" style="left:100.25px;top:-2.277px;">Investigation</span></div></div><div id="spr7_907629b7" style="left:592.557px;top:3.6px;"><div style="width:0px;"><span id="txt2_907629b7" data-width="77.211914" style="left:-51.652px;top:-2.277px;">Reasoning</span></div></div><div id="spr8_907629b7" style="left:-0.002px;top:61.2px;"><div style="width:0px;"><span id="txt3_907629b7" data-width="21.512695" style="left:137.39px;top:-30.571px;">FBC</span></div></div><div id="spr9_907629b7" style="left:592.559px;top:61.2px;"><div style="width:0px;"><span id="txt4_907629b7" data-width="291.778320" style="left:-289.08px;top:-30.571px;">To check for anaemia(which can contribute to SOB)</span></div></div><div id="spr10_907629b7" style="left:-0.002px;top:110.809px;"><div style="width:0px;"><span id="txt5_907629b7" data-width="23.132813" style="left:136.66px;top:-55.376px;">ECG</span></div></div><div id="spr11_907629b7" style="left:592.559px;top:110.809px;"><div style="width:0px;"><span id="txt6_907629b7" data-width="533.018555" style="left:-289.08px;top:-55.376px;">Exclude any ischemia, arrythmias (e.g. atrial fibrillation) which could be a precipitant for heart</span></div><div style="width:0px;"><span id="txt7_907629b7" data-width="36.606445" style="left:-289.08px;top:-38.576px;">failure</span></div></div><div id="spr12_907629b7" style="left:-0.002px;top:233.134px;"><div style="width:0px;"><span id="txt8_907629b7" data-width="25.552734" style="left:135.85px;top:-116.538px;">TFTs</span></div></div><div id="spr13_907629b7" style="left:592.559px;top:233.134px;"><div style="width:0px;"><span id="txt9_907629b7" data-width="443.235352" style="left:-289.08px;top:-116.538px;">Hyperthyroidism can cause a tachyarrhythmias and contribute to heart failure</span></div></div><div id="spr14_907629b7" style="left:-0.002px;top:318.762px;"><div style="width:0px;"><span id="txt10_907629b7" data-width="30.843750" style="left:132.702px;top:-159.352px;">U&amp;Es</span></div></div><div id="spr15_907629b7" style="left:592.559px;top:318.762px;"><div style="width:0px;"><span id="txt11_907629b7" data-width="535.629883" style="left:-289.08px;top:-159.352px;">For Baseline. It is important to monitor electrolytes when giving drugs that will be discussed in</span></div><div style="width:0px;"><span id="txt12_907629b7" data-width="85.647461" style="left:-289.08px;top:-142.552px;">the next slides.</span></div><div style="width:0px;"><span id="txt13_907629b7" data-width="341.694336" style="left:-289.08px;top:-125.752px;">Furthermore, renal dysfunction can exacerbate heart failure</span></div></div><div id="spr16_907629b7" style="left:-0.002px;top:514.481px;"><div style="width:0px;"><span id="txt14_907629b7" data-width="24.616211" style="left:136.35px;top:-257.212px;">LFTs</span></div></div><div id="spr17_907629b7" style="left:592.559px;top:514.481px;"><div style="width:0px;"><span id="txt15_907629b7" class="relpos" data-width="483.724609" style="left:-289.08px;top:-257.212px;">For Baseline. Furthermore decreased albumin can lead to deceased oncotic pressure </span><span id="txt16_907629b7" class="relpos" style="left:-289.085px;top:-254.922px;"></span><span id="txt17_907629b7" class="relpos" data-width="45.780273" style="left:-289.09px;top:-257.212px;"> causing</span></div><div style="width:0px;"><span id="txt18_907629b7" data-width="524.289063" style="left:-289.08px;top:-240.412px;">fluid and volume overload. This can look similar to symptoms seen in acute heart failure and</span></div><div style="width:0px;"><span id="txt19_907629b7" data-width="153.945313" style="left:-289.08px;top:-223.612px;">thus needs to be ruled out.</span></div></div><div id="spr18_907629b7" style="left:-0.002px;top:710.201px;"><div style="width:0px;"><span id="txt20_907629b7" data-width="22.333008" style="left:136.952px;top:-355.071px;">CXR</span></div></div><div id="spr19_907629b7" style="left:592.559px;top:710.201px;"><div style="width:0px;"><span id="txt21_907629b7" data-width="449.579102" style="left:-289.08px;top:-355.071px;">Look for signs of heart failure. Rule out pneumonia, fibrosis, bronchiectasis etc.</span></div></div><div id="spr20_907629b7" style="left:-0.003px;top:795.828px;"><div style="width:0px;"><span id="txt22_907629b7" data-width="192.971680" style="left:51.837px;top:-397.885px;">Blood glucose, cholesterol, HbA1c</span></div></div><div id="spr21_907629b7" style="left:592.559px;top:795.828px;"><div style="width:0px;"><span id="txt23_907629b7" data-width="525.478516" style="left:-289.08px;top:-397.885px;">Monitor diabetes, cholesterol. Poor control of diabetes can contribute to worsening of heart</span></div><div style="width:0px;"><span id="txt24_907629b7" data-width="40.140625" style="left:-289.08px;top:-381.085px;">failure.</span></div></div><div id="spr22_907629b7" style="left:-0.002px;top:877.428px;"><div style="width:0px;"><span id="txt25_907629b7" data-width="23.884766" style="left:136.202px;top:-438.685px;">BNP</span></div></div><div id="spr23_907629b7" style="left:592.559px;top:877.428px;"><div style="width:0px;"><span id="txt26_907629b7" data-width="353.267578" style="left:-289.08px;top:-438.685px;">Has high sensitivity. Thus if low can help rule out heart failure.</span></div></div></div><div id="spr24_907629b7" style="left:66px;top:28.75px;"><div style="width:0px;"><span id="txt27_907629b7" data-width="758.962891" style="left:7.2px;top:10.304px;">JAMES HAS A CHEST X-RAY TAKEN. WHAT DOES THE CHEST X-RAY BELOW SHOW?</span></div></div><div id="spr25_907629b7" style="left:274.213px;top:102.726px;"><img id="img1_907629b7" src="data:image/png;base64," width="391" height="418" alt="" style="left:0.109px;top:0.176px;"/></div><div id="svg7_907629b7" style="left:601.511px;top:390.408px;"><svg width="203" height="48" viewBox="-0.556 -1.273 203 48"><g fill="none"><g transform="translate(0.0802,1.63501)"><g fill="#1cade4" stroke="none" transform="translate(-0.080185,-1.635006)"><path stroke="#1cade4" stroke-width="0.8" stroke-linecap="butt" transform="translate(0.080185,1.635006)" d="M200.842,43.958 L5.234,1.146"/><path transform="matrix(-0.976876,-0.213807,0.213807,-0.976876,200.922318,45.592953)" d="M205.596,0 L199.643,2.977 V-2.977 Z"/></g></g></g></svg></div><div id="spr26_907629b7" style="left:802.989px;top:430.469px;"><div style="width:0px;"><span id="txt28_907629b7" data-width="103.491211" style="left:7.2px;top:5.172px;">Cardiomegaly</span></div></div><div id="svg15_907629b7" style="left:193.271px;top:217.524px;"><svg width="171" height="82" viewBox="-0.592 -0.41 171 82"><g fill="none"><g transform="translate(0.157822,0.340164)"><g fill="#1cade4" stroke="none" transform="translate(-0.157827,-0.34017)"><path stroke="#1cade4" stroke-width="0.8" stroke-linecap="butt" transform="translate(0.157827,0.34017)" d="M0,0 L163.392,75.808"/><path transform="matrix(0.90712,0.420871,-0.420871,0.90712,0.157827,0.34017)" d="M185.48,0 L179.526,2.977 V-2.977 Z"/></g></g></g></svg></div><div id="spr27_907629b7" style="left:46.908px;top:153.675px;"><div style="width:0px;"><span id="txt29_907629b7" data-width="171.940430" style="left:7.2px;top:5.173px;">Bilateral opacification –</span></div><div style="width:0px;"><span id="txt30_907629b7" data-width="110.258789" style="left:7.2px;top:26.773px;">due to alveolar</span></div><div style="width:0px;"><span id="txt31_907629b7" data-width="123.205078" style="left:7.2px;top:48.373px;">oedema. It is in a</span></div><div style="width:0px;"><span id="txt32_907629b7" data-width="144.764648" style="left:7.2px;top:69.973px;">perihilar (bat wings)</span></div><div style="width:0px;"><span id="txt33_907629b7" data-width="78.213867" style="left:7.2px;top:91.573px;">distribution</span></div></div><div id="svg23_907629b7" style="left:228.134px;top:467.776px;"><svg width="70" height="22" viewBox="-0.653 -1.534 70 22"><g fill="none"><g transform="translate(0.096619,1.342255)"><g fill="#1cade4" stroke="none" transform="translate(-0.096624,-1.342247)"><path stroke="#1cade4" stroke-width="0.8" stroke-linecap="butt" transform="translate(0.096624,1.342247)" d="M0,18.19 L63.033,1.381"/><path transform="matrix(0.966235,-0.257663,0.257663,0.966235,0.096624,19.531782)" d="M70.594,0 L64.641,2.977 V-2.977 Z"/></g></g></g></svg></div><div id="spr28_907629b7" style="left:44.562px;top:479.513px;"><div style="width:0px;"><span id="txt34_907629b7" data-width="167.642578" style="left:7.2px;top:5.173px;">Blunting of costophrenic</span></div><div style="width:0px;"><span id="txt35_907629b7" data-width="126.105469" style="left:7.2px;top:26.773px;">angles bilaterally</span></div></div></div></div>');})();